import React from 'react'
import { useSelector } from 'react-redux'

function ProfileEdit() {

    const { user } = useSelector(state => state.auth)
    if (user) {
        return (
            <div>
                ProfileEdit
            </div>
        )
    } else {
        return (
            <></>
        )
    }
}

export default ProfileEdit
